import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="nav">
          <ul>
            <li className="list-item">Home</li>
            <li className="list-item">About</li>
            <li className="list-item">Contate</li>

          </ul>
        </div>
      </header>
    </div>
  );
}

function Navbar() {

  return(
    <div className="navbar">
    <div className="brand-logo">Hello</div>
    <div className="list">
      <ul>
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Project</a></li>
        <li><a href="#">About</a></li>
      </ul>
    </div>
  </div>
  )
}

export default App;
